import './App.css';
/*import Main1 from './Shopping/Main1';*/
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import Main from './Netflix/Main';
import Freeapp from './Netflix/Freeapp';
import Signin from './Netflix/Signin';

function App() {
  return (
  <>
  <BrowserRouter>
  <Main/>
  <Routes>
		      <Route exact path="/signin"> <Signin/> </Route>
			  <Route  path="/freeapp" > <Freeapp/> </Route>
  </Routes>
  </BrowserRouter>
  </>
  );
}

export default App;
